import React from 'react';

import Tile from '../components/Tile/Tile'

import styles from './AppointmentPage.module.css'


const BASE_URL = "https://back-q-doctor.herokuapp.com/api"
const APPOINTMENT_URL = "/people/appointments"


export default ({ departments, handleDeleteAllAppointment, handleDeleteAppointment }) => {
		const doctors = [...new Set(departments.map(x => x.available_resource_id))];
		return (
			<div className={styles.page}>
				<ul className={styles.list}>
					{doctors
						.map(doctor => 
							<Tile
								key={doctor}
								handleDelete={() => handleDeleteAllAppointment(doctor)}
								handleDeleteItem={handleDeleteAppointment}
								appointments={departments.filter(x => x.available_resource_id === doctor)}
							/>)
					}
				</ul>
			</div>
		);
}
